class QuickstartUser(HttpUser):
    """
    –ö–ª–∞—Å—Å "–ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è" –ø–æ–¥–∞—é—â–µ–≥–æ –∑–∞–ø—Ä–æ—Å –≤ —Ä—É—á–∫—É —Å–µ—Ä–≤–∏—Å–∞ /predict —Å–æ
    —Å–≥–µ–Ω–µ—Ä–∏—Ä–æ–≤–∞–Ω–Ω—ã–º–∏ –ø—Ä–∏–∑–Ω–∞–∫–∞–º–∏ –∞–≤—Ç–æ–º–æ–±–∏–ª—è.
    """
    wait_time = between(0.5, 1)

    @task
    def predict(self):
        """
        –ú–µ—Ç–æ–¥ –∫–ª–∞—Å—Å–∞ "–ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è", –ø–æ—Å—ã–ª–∞—é—â–∏–π POST –∑–∞–ø—Ä–æ—Å –≤
        —Ä—É—á–∫—É —Å–µ—Ä–≤–∏—Å–∞ /predict —Å–æ —Å–≥–µ–Ω–µ—Ä–∏—Ä–æ–≤–∞–Ω–Ω—ã–º–∏ –ø—Ä–∏–∑–Ω–∞–∫–∞–º–∏ –∞–≤—Ç–æ–º–æ–±–∏–ª—è.
        """
        self.client.post('/predict/', json=generate_car())
